import React, { useEffect, useRef, useState } from "react";
import "./Video.css";

function formatCount(count) {
  const num = Number(count.toString().replace(/[^\d.]/g, ""));
  if (isNaN(num)) return count;
  if (num >= 1_000_000) return (num / 1_000_000).toFixed(1) + "M";
  if (num >= 1_000) return (num / 1_000).toFixed(1) + "K";
  return num;
}

function Video({ url, channel, description, likes = 0, dislikes = 0, comments = 0 }) {
  const videoRef = useRef(null);
  const [isMuted, setIsMuted] = useState(true);
  const [likeCount, setLikeCount] = useState(Number(likes) || 0);
  const [dislikeCount, setDislikeCount] = useState(Number(dislikes) || 0);
  const [isLiked, setIsLiked] = useState(false);
  const [isDisliked, setIsDisliked] = useState(false);

  const onLike = () => {
    setIsLiked(!isLiked);
    setLikeCount((prev) => (isLiked ? prev - 1 : prev + 1));
    if (isDisliked) {
      setIsDisliked(false);
      setDislikeCount((prev) => prev - 1);
    }
  };

  const onDislike = () => {
    setIsDisliked(!isDisliked);
    setDislikeCount((prev) => (isDisliked ? prev - 1 : prev + 1));
    if (isLiked) {
      setIsLiked(false);
      setLikeCount((prev) => prev - 1);
    }
  };

  const onComment = () => {
    alert("Комментарии пока не реализованы.");
  };

  const onShare = () => {
    navigator.clipboard.writeText(window.location.href);
    alert("Ссылка скопирована!");
  };

  const toggleMute = () => {
    if (videoRef.current) {
      videoRef.current.muted = !videoRef.current.muted;
      setIsMuted(videoRef.current.muted);
    }
  };

  // Останавливает звук на других видео при переходе
  useEffect(() => {
    const videos = document.querySelectorAll("video");
    videos.forEach((v) => {
      if (v !== videoRef.current) v.muted = true;
    });
  });

  return (
    <div className="video" onClick={toggleMute}>
      <video
        className="video__player"
        src={url}
        ref={videoRef}
        autoPlay
        loop
        muted={isMuted}
        playsInline
      />

      <div className="video__sidebar">
        <div className={`video__button ${isLiked ? "active" : ""}`} onClick={(e) => { e.stopPropagation(); onLike(); }}>
          <img src={process.env.PUBLIC_URL + "/icons/like.svg"} alt="Like" />
          <span>{formatCount(likeCount)}</span>
        </div>
        <div className={`video__button ${isDisliked ? "active" : ""}`} onClick={(e) => { e.stopPropagation(); onDislike(); }}>
          <img src={process.env.PUBLIC_URL + "/icons/dislike.svg"} alt="Dislike" />
          <span>{formatCount(dislikeCount)}</span>
        </div>
        <div className="video__button" onClick={(e) => { e.stopPropagation(); onComment(); }}>
          <img src={process.env.PUBLIC_URL + "/icons/comment.svg"} alt="Comment" />
          <span>{formatCount(comments)}</span>
        </div>
        <div className="video__button" onClick={(e) => { e.stopPropagation(); onShare(); }}>
          <img src={process.env.PUBLIC_URL + "/icons/share.svg"} alt="Share" />
        </div>
      </div>

      <div className="video__footer">
        <div className="video__channel">
          <p>@{channel}</p>
          <button>Подписаться</button>
        </div>
        <div className="video__description">{description}</div>
      </div>
    </div>
  );
}

export default Video;
